const Registration = () => {

  return(
  <div className="container">
      <div className="row">
        <div className="col-sm-12">
          <form method="POST">
            <label >FirstName</label>
            <input type="text" name="fname" placeholder="Enter First Name" />
          </form>
        </div>
      </div>
  </div>
  );


}

export default Registration;
